    static displayName = 'Defs';

    render() {
        return <RNSVGDefs>{this.props.children}</RNSVGDefs>;
    }
}

const RNSVGDefs = createReactNativeComponentClass('RNSVGDefs', () => ({
    validAttributes: {},
    uiViewClassName: 'RNSVGDefs'
